Sniper.Ghost.Warrior+working included crack

This is the playable demo for Sniper: Ghost Warrior, a stealth based action game where players must find and stalk targets before quickly taking them out at range with a single shot. Continue reading after the jump for system requirements.

&quot;The Latin nation of Isla Trueno suffers under a tyrannical ruler and as Marine Sgt. Tyler Wells, you have been sent on a covert mission deep into its jungles to aid the rebellion, one head shot at a time.&quot;
